import { render } from '@testing-library/react';
import React from 'react';

class PersonasForm extends React.Component{

    constructor(){
        super(props)
        this.state={
        }
    }

    render(){
        return (
            <div>
               <div class="row">
                   <h4 className="center">Nuevo Contacto</h4>
                    <form class="col s12">
                    <div class="row">
                        <div class="input-field col s6">
                            <input id="nombre" ref="nombre" type="text" class="validate" />
                            <label htmlFor="nombre">Last Name</label>
                        </div>
                    </div>
                    </form>
                </div>
            </div>
        )
    }
   
}

export default PersonasForm;
